import React from 'react'
import teams from '../teams'

const Teams = () => {
    return (
        <div>
                <ul>
                    {teams.map(team => (
                        <li><p>{team.teamName}</p></li>
                    ))}      
                </ul>
        </div>
    )
}

export default Teams
